import React from "react";
import { Route, Routes } from "react-router-dom";
import ErrorSection from "../../Error/ErrorSection";

const Settings = () => {
  return (
    <Container>
      <Title>Settings</Title>
      <Wrapper>
        <Menu>
          <MenuList>
            <MenuItem>
              <i className="fa-sharp fa-regular fa-roller-coaster"></i>
              <ItemWrapper>
                <ItemTitle>Appereance</ItemTitle>
                <ItemSubtitle>Dark and Light Mode, Font size</ItemSubtitle>
              </ItemWrapper>
            </MenuItem>
          </MenuList>
        </Menu>
        <Main>
          <Routes>
            <Route path="error" element={<ErrorSection />} />
          </Routes>
        </Main>
      </Wrapper>
    </Container>
  );
};

export default Settings;
